        are expressly permitted to reproduce the contents of the PD Online website
        in their web browser (and in any cache file produced by their web browser)
        for the sole purpose of their personal non-commercial viewing of the content
        and printing of pdf documentation. </p>\n<h5>Disclaimer</h5>\n<p>The information
        provided by PD Online is made available as a general reference source only.
        </p>\n<p>PD Online is not intended to be used, and must not be used, for formal
