        to access to, use of, or reliance upon: </p>\n<ul>\n    <li>the information
        obtained using PD Online; or </li>\n    <li>the PD Online system itself. </li>\n</ul>\n<h5>Right
        to Grant or Refuse Access</h5>\n<p>Access to PD Online is at the discretion
        of the Council. The Council reserves the right to refuse to allow access to
        any part of PD Online without prior notice, and without the need to give any
        reason for doing so. </p>\n<h5>Information Privacy and collection of personal
        information</h5>\n<p>PD Online may record some information about each access
        to PD Online (for example, the lP address of the computer from which PD Online
        is accessed, the date and time of access, and the pages, documents or information
        accessed). This information is used for statistical and site development purposes.
        </p>\n<p>Except for information specifically provided by users, the Council
        does not collect any other personal information during use of PD Online. Any
        personal information specifically provided will not be disclosed to third
        parties except with the consent of the subject user, or where required by
        law. </p>\n<p>The Council takes steps to maintain the currency and accuracy
        of the personal information it holds. If users require access to any personal
        information about them that may be held by the Council, or if users have any
        other questions about information privacy, e-mail the Council at <a href=\"mailto:rcc@redland.qld.gov.au\"><span
        style=\"text-decoration: underline;\">rcc@redland.qld.gov.au</span></a> or
        call the Council on (07) 3829 8999. </p>\n<h5>Use and discloser of personal
        information</h5>\n<p>The personal information we collect and store can only
        be used and disclosed in accordance with the Information Privacy Principles
        within the <em>Information Privacy Act 2009</em>. Under the <em>Information
        Privacy Act 2009</em> Council may use and disclose personal information if
        it is required or authorised by law. Council is authorised to disclose personal
        information relating to applications and submissions in accordance with schedule
        22 of the Planning Regulation 2017. Applicant details, copies of submissions
        and decision notices are all available for inspection and published online
        on PD Online. Names, addresses and signatures are all published in accordance
        with the Planning Act 2016. If making a submission, please be aware that your
        submission is not confidential and will be made publically available. </p>\n<h5>Accessing
        your personal information</h5>\n<p>If you require access to your personal
        information held by Council, or if you have any other questions about information
        privacy, email Redland City Council at <a href=\"mailto:rti.ip@redland.qld.gov.au\"><span
        style=\"text-decoration: underline;\">rti.ip@redland.qld.gov.au</span></a>
        or call Redland City Council on (07) 3829 8999. </p>\n<h5>Governing Law</h5>\n<p>All
        matters relating to this website are governed by the laws of the State of
        Queensland, Australia and users submit to the non-exclusive jurisdiction of
        the Courts of that State and courts of appeal from them. </p>\n<h5>Use of
